import '../../App.css';

function Header() {
  return (
    <div style={{ top: 0, width: '100%', paddingLeft: 20, paddingTop: 10 }}>
      <div style={{ display: 'flex', flexDirection: 'row', justifyContent: 'center', alignItems: 'center' }}>
        <div style={{ width: 15, height: 5, backgroundColor: 'blue' }} />
        <h1>COMPANY NAME</h1>
      </div>
    </div>
  );
}

export default Header;
